#include <iostream>
#include <map>
#include <string>
using namespace std;

class Solution {
public:
	int lengthOfLongestSubstring(string s) {
		int longest = 0;
		int last = 0;
		for (int i = 0; i < s.length(); ++i)
		{
			bool repeat = false;
			for (int j = last; j < s.length() && !repeat; ++j)
			{
				for (int k = i; k < j; ++k)
				{
					if (s[j]==s[k])
					{
						repeat = true;
						if (j-i > longest)
						{
							longest = j-i;
						}
						i = k;
						last = j;
					}
				}
			}
			if (!repeat && s.length()-i > longest)
			{
				longest = s.length()-i;
			}
		}
		return longest;
	}
	int lengthOfLongestSubstring_2(string s) {
		int longest = 0;
		for (int i = 0; i < s.length(); ++i)
		{
			map<char, int> pass;
			bool repeat = false;
			for (int j = i; j < s.length() && !repeat; ++j)
			{
				if (pass.find(s[j]) == pass.end())
				{
					pass[s[j]] = j;
				}
				else
				{
					repeat = true;
					if (j-i > longest)
					{
						longest = j-i;
					}
					i = pass[s[j]];
				}
			}
		}
		return longest;
	}
};

